import { FaShoppingCart } from "react-icons/fa";
import {NavLink} from "react-router-dom";

const Navbar = () => {
  return (
    <div>
        <div className="flex justify-between items-center h-20 max-w-6xl mx-auto">
          <NavLink to="/">
            <img src=""></img>
          </NavLink>
          
          <div>
            <p>Home</p>

            <NavLink to="/cart">
              <div>
                <FaShoppingCart />
              </div>
            </NavLink>

          </div>
        </div>
    </div>
  )
};

export default Navbar;
